import Contact from './Contact'
import AddModel from './components/admin/AddModel'

class clientPage extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
            <>
                <NavBar/>
                <HeroHeader/>
                <ModelesPage/>
                <Contact/>
                <Footer/>
                <AddModel/>
            </>
         );
    }
}

export default clientPage;
